import React, {Component} from 'react';
import Todos from './components/Todos'
import './App.css';

class App extends Component {
  state = {
    todos : [
      {
        id : 1,
        title : 'Trash'
      },
      {
        id : 2,
        title : 'Tip'
      },
      {
        id : 3,
        title : 'Hi'
      }
    ]
  }

  renderer() {
    return (
      <div className="App">
        <Todos todos={this.state.todos}/>
      </div>
    );
  }

}

export default App;
